import{_ as a,c as n,a as i,o as r}from"./app-B2Okz-zd.js";const d={};function c(t,e){return r(),n("div",null,e[0]||(e[0]=[i('<blockquote><p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。 欢迎关注公众号「AI Reading Hub」，获取更多AI资讯和技术文章。</p></blockquote><h1 id="_2025-11-10-资讯日报" tabindex="-1"><a class="header-anchor" href="#_2025-11-10-资讯日报"><span>2025-11-10 资讯日报</span></a></h1><h2 id="新闻资讯" tabindex="-1"><a class="header-anchor" href="#新闻资讯"><span>新闻资讯</span></a></h2><h3 id="aaai-2026录用揭晓-审稿引争议" tabindex="-1"><a class="header-anchor" href="#aaai-2026录用揭晓-审稿引争议"><span>AAAI 2026录用揭晓，审稿引争议</span></a></h3><p>AAAI 2026录用结果揭晓，投稿23,680篇，录用率17.6%。北大顾怿洋、南洋理工加小俊等研究员成果颇丰。但Reddit上有人质疑审稿过程，称存在‘关系户’抬分现象。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f0055191a7908ced6fc4543d68c61eb32b99a443f7e5d58511b32e80aee3b5a0e05ca2619233&amp;idx=1&amp;mid=2652643627&amp;sn=6887dbda64d7b14599d683940341b5dd#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="ai炮制失踪故事-网友上头真假难辨" tabindex="-1"><a class="header-anchor" href="#ai炮制失踪故事-网友上头真假难辨"><span>AI炮制失踪故事，网友上头真假难辨</span></a></h3><p>新智元报道，AI炮制的“人类失踪”视频在网上爆火，观看量高，网友沉迷其中。虽故事为假，但能吊起好奇心。不过，虚假内容泛滥也引发对真假难辨的担忧。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f0fb6c603bbdb3ed6fac9d0967f9cc87aed9a55de867cf3acb62548031ab3e11e267b4f43aff&amp;idx=2&amp;mid=2652643627&amp;sn=1f7cbc97486e3faf4b0256f605ee99da#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="产品应用" tabindex="-1"><a class="header-anchor" href="#产品应用"><span>产品应用</span></a></h2><h3 id="银河通用dexndm-让机器人-手到擒来" tabindex="-1"><a class="header-anchor" href="#银河通用dexndm-让机器人-手到擒来"><span>银河通用DexNDM：让机器人“手到擒来”</span></a></h3><p>银河通用DexNDM模型实现机器人手内旋转和工具操作突破。它分解手物交互到关节级，采用创新训练流程，提升操作灵活性与泛化能力，推动机器人从简单抓取迈向精细操作，走向生产力应用。<a href="https://mp.weixin.qq.com/s?__biz=MzIzNjc1NzUzMw==&amp;chksm=e9ee0ba6ccad45fcd56b9dfa63e7515b4fa6faf6fe768ade69863a12ff394a5545c1d560c071&amp;idx=1&amp;mid=2247840571&amp;sn=fb6b16b091ba464b72673f026a7da6e6#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="谷歌nano-banana-2来袭-图片agi或提前到来" tabindex="-1"><a class="header-anchor" href="#谷歌nano-banana-2来袭-图片agi或提前到来"><span>谷歌Nano Banana 2来袭，图片AGI或提前到来</span></a></h3><p>谷歌Nano Banana 2提前来袭，能自我纠错，可替代部分Photoshop功能，在细节和配色上比一代强，指令遵循能力提升3倍，支持多种长宽比和分辨率，即将正式上线。<a href="https://mp.weixin.qq.com/s?__biz=MzkxNjcyNTk2NA==&amp;chksm=c0801313476547fe47f0b1fd8499fe196c678c481f83bdedb146086782acb1fc83c7e55758e5&amp;idx=1&amp;mid=2247488600&amp;sn=bd75dd59bd96f9cd62cc9ccbfbda2dc8#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="ai自动编写单元测试-代码采纳率提至50" tabindex="-1"><a class="header-anchor" href="#ai自动编写单元测试-代码采纳率提至50"><span>AI自动编写单元测试：代码采纳率提至50%</span></a></h3><p>借势分享借助Aone Copilot Agent进行AI自动编写单元测试实践。精心设计prompt，AI代码采纳率达50%，实现效率提升、质量保证和团队赋能，强调持续优化prompt及扩展应用场景。<a href="https://mp.weixin.qq.com/s?__biz=MzIzOTU0NTQ0MA==&amp;chksm=e80dc57bb888185c8d4736c68e80b7286c84e4f41b1e54a028fd0a5d5dbc900f04fe1b985af1&amp;idx=1&amp;mid=2247555282&amp;sn=736db5cd8e22ab829b135721b8a2c49e#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="推荐文章" tabindex="-1"><a class="header-anchor" href="#推荐文章"><span>推荐文章</span></a></h2><h3 id="ai-agent-落地-人-与-流程-成最大障碍" tabindex="-1"><a class="header-anchor" href="#ai-agent-落地-人-与-流程-成最大障碍"><span>AI Agent 落地：‘人’与‘流程’成最大障碍</span></a></h3><p>MMC 报告指出，AI Agent 落地最大障碍是‘人’与‘流程’问题，包括工作流集成、员工抵触、数据隐私等。企业开始付费，但收费模式待摸索。成功落地要从小处着手、提供‘保姆式’服务并做好定位。<a href="https://mp.weixin.qq.com/s?__biz=Mzk1NzgxMjQ0OA==&amp;chksm=c2c9b7db2d9e1913ae5072f3254f902e085f5bbff9c414b2ff22480f83603c9677a4ba36f24c&amp;idx=1&amp;mid=2247491085&amp;sn=2cd56a205e01a4aaf8d8c6a15a57ecfb#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="开源动态" tabindex="-1"><a class="header-anchor" href="#开源动态"><span>开源动态</span></a></h2><h3 id="kimi-k2-thinking多项评估超越顶尖闭源模型" tabindex="-1"><a class="header-anchor" href="#kimi-k2-thinking多项评估超越顶尖闭源模型"><span>Kimi K2 Thinking多项评估超越顶尖闭源模型</span></a></h3><p>月之暗面发布Kimi K2 Thinking，基于模型即智能体理念训练，能自主工具调用与思考。多项评估超顶尖闭源模型，实现原生INT4量化提升效率，代码和权重可在多平台下载。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cfcd255d425462e9aa1f409045fb6f7a96d33de9ffe76d4e991a177cb565f51fd6e81af6f779&amp;idx=2&amp;mid=2247525165&amp;sn=85bb3de9e619c96ef55ebfbf2871513c#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="meshcoder-革新3d生成的结构化代码方案" tabindex="-1"><a class="header-anchor" href="#meshcoder-革新3d生成的结构化代码方案"><span>MeshCoder：革新3D生成的结构化代码方案</span></a></h3><p>团队推出MeshCoder，将三维输入转结构化代码。它能分部件生成、构建四边面网格，代码易编辑、网格密度可控。实验显示性能卓越，但训练集不足，后续将扩充数据提升泛化力。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=851a8b240624c1000d1c3f5eb8f5b0795d4d78002da158ef8e7ec830ebc3bf1ca37f1b4fb981&amp;idx=2&amp;mid=2651000751&amp;sn=c44d55c71b20f4a0cd3592c3adb94da8#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="微软开源智能呼叫中心替代人工客服" tabindex="-1"><a class="header-anchor" href="#微软开源智能呼叫中心替代人工客服"><span>微软开源智能呼叫中心替代人工客服</span></a></h3><p>微软：开源智能呼叫中心，基于Azure和OpenAI GPT，能完全替代人工客服。具备多种功能特性，如增强沟通体验、高级智能管理等。还给出详细部署步骤和高级用法说明。<a href="https://mp.weixin.qq.com/s?__biz=MzkxNjQ4MzMyOA==&amp;chksm=c097e6ca1ce3034c317a6ef1314a0fe0856bf9abc7f86c231ecaa4ed98161eb767df5a526629&amp;idx=1&amp;mid=2247494179&amp;sn=6911952a83452732d3f54856c9449bf5#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="超对称开源-monte-carlo-注意力" tabindex="-1"><a class="header-anchor" href="#超对称开源-monte-carlo-注意力"><span>超对称开源 Monte Carlo 注意力</span></a></h3><p>超对称技术公司开源 Monte Carlo 注意力，用于 BigBang - Proton 模型。它解决了超长上下文长度需求，无须分阶段训练，降低计算复杂度，突破传统技术限制，还对比了与其他注意力机制的差异。<a href="https://mp.weixin.qq.com/s?__biz=Mzg4NDQwNTI0OQ==&amp;chksm=cebc7dbaad89177c65d9326482a4a87cea714b084a4904c37c89c2e6960c933bb336e9bdec99&amp;idx=1&amp;mid=2247588415&amp;sn=42fe75aaf5307e6ac3d425cdac31ad7d#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="whisperlivekit-本地实时语音转文字神器" tabindex="-1"><a class="header-anchor" href="#whisperlivekit-本地实时语音转文字神器"><span>WhisperLiveKit：本地实时语音转文字神器</span></a></h3><p>WhisperLiveKit项目解决实时语音转文字难题，用前沿同步语音技术，支持多语言同步翻译、说话人识别。介绍了安装、部署方式，虽效果受语言等因素影响，但自部署优先的AI应用可尝试。<a href="https://mp.weixin.qq.com/s?__biz=MzA5MTIxNTY4MQ==&amp;chksm=869ac6068ad9dd82886a8b2a40e80ae4c5616fb0d36c5b4964566bb8fcf3e3bcf29b37c3b4af&amp;idx=1&amp;mid=2461156268&amp;sn=6fa91ca17f09988ba2d9cdb0aef160c2#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="算法论文" tabindex="-1"><a class="header-anchor" href="#算法论文"><span>算法论文</span></a></h2><h3 id="谢赛宁等提出视频多模态llm新范式" tabindex="-1"><a class="header-anchor" href="#谢赛宁等提出视频多模态llm新范式"><span>谢赛宁等提出视频多模态LLM新范式</span></a></h3><p>谢赛宁、李飞飞、LeCun 团队提出「Cambrian - S」探索视频空间超感知。研究引入 VSI - Super 基准，指出当前范式不足。提出预测性感知范式，在 VSI - SUPER 测试中表现优于基线，呼吁范式转变。<a href="https://mp.weixin.qq.com/s?__biz=MzA3MzI4MjgzMw==&amp;chksm=85628380b2114ba9b55dcf270d92c52aad6f10c07bf26b4476fa9780db2f94fb9cf434359b33&amp;idx=1&amp;mid=2651000751&amp;sn=cea3a25301742d58fd9a073625dd475a#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="谷歌nested-learning让ai拥有持续学习力" tabindex="-1"><a class="header-anchor" href="#谷歌nested-learning让ai拥有持续学习力"><span>谷歌Nested Learning让AI拥有持续学习力</span></a></h3><p>谷歌科学家针对AI难以形成新长期记忆难题，提出Nested Learning理论，认为架构与优化算法是统一系统。基于此提出三大核心贡献，构建HOPE架构，性能超对比模型，将改变终身学习应用领域。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cfbd31eea164eb15d2ced6adadf15646352f69c1b5a46ca98e62334a92d6fe0018097bc69ad9&amp;idx=1&amp;mid=2247525165&amp;sn=9245386faf13871b17a989c5ff0b3b60#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="trajselector-0-6b模型撬动复杂推理" tabindex="-1"><a class="header-anchor" href="#trajselector-0-6b模型撬动复杂推理"><span>TrajSelector：0.6B模型撬动复杂推理</span></a></h3><p>哈工大、中科院等提出TrajSelector框架，通过复用模型隐藏状态和弱监督训练，用0.6B验证器超越7B裁判模型。在数学竞赛基准测试表现佳，还能筛选数据，但在开放域问答待解难题。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cff94133789170d967cf6efb203beec2c08ac4d60e5ef4db143c245b8c16f9aa9489d2ec201e&amp;idx=3&amp;mid=2247525165&amp;sn=cbd0a5bc97abd48d3d82cb7c19d68e10#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><p style="text-align:center;"><img id="weixin_qr" src="https://meikan-public-images.oss-cn-beijing.aliyuncs.com/imeikan/assets/2025-05-18234303-hub.png" style="max-width:800px;object-fit:cover;"></p><p><a href="https://aireadinghub.com/" target="_blank" rel="noopener noreferrer">官网：www.AiReadingHub.com</a></p>',37)]))}const s=a(d,[["render",c]]),p=JSON.parse('{"path":"/posts/2025-11-10.html","title":"AI日报：AAAI 2026录用揭晓，审稿引争议; AI炮制失踪故事，网友上头真假难辨; 银河通用DexNDM：让机器人“手到擒来”","lang":"zh-CN","frontmatter":{"date":"2025-11-10T00:00:00.000Z","title":"AI日报：AAAI 2026录用揭晓，审稿引争议; AI炮制失踪故事，网友上头真假难辨; 银河通用DexNDM：让机器人“手到擒来”"},"headers":[{"level":2,"title":"新闻资讯","slug":"新闻资讯","link":"#新闻资讯","children":[{"level":3,"title":"AAAI 2026录用揭晓，审稿引争议","slug":"aaai-2026录用揭晓-审稿引争议","link":"#aaai-2026录用揭晓-审稿引争议","children":[]},{"level":3,"title":"AI炮制失踪故事，网友上头真假难辨","slug":"ai炮制失踪故事-网友上头真假难辨","link":"#ai炮制失踪故事-网友上头真假难辨","children":[]}]},{"level":2,"title":"产品应用","slug":"产品应用","link":"#产品应用","children":[{"level":3,"title":"银河通用DexNDM：让机器人“手到擒来”","slug":"银河通用dexndm-让机器人-手到擒来","link":"#银河通用dexndm-让机器人-手到擒来","children":[]},{"level":3,"title":"谷歌Nano Banana 2来袭，图片AGI或提前到来","slug":"谷歌nano-banana-2来袭-图片agi或提前到来","link":"#谷歌nano-banana-2来袭-图片agi或提前到来","children":[]},{"level":3,"title":"AI自动编写单元测试：代码采纳率提至50%","slug":"ai自动编写单元测试-代码采纳率提至50","link":"#ai自动编写单元测试-代码采纳率提至50","children":[]}]},{"level":2,"title":"推荐文章","slug":"推荐文章","link":"#推荐文章","children":[{"level":3,"title":"AI Agent 落地：‘人’与‘流程’成最大障碍","slug":"ai-agent-落地-人-与-流程-成最大障碍","link":"#ai-agent-落地-人-与-流程-成最大障碍","children":[]}]},{"level":2,"title":"开源动态","slug":"开源动态","link":"#开源动态","children":[{"level":3,"title":"Kimi K2 Thinking多项评估超越顶尖闭源模型","slug":"kimi-k2-thinking多项评估超越顶尖闭源模型","link":"#kimi-k2-thinking多项评估超越顶尖闭源模型","children":[]},{"level":3,"title":"MeshCoder：革新3D生成的结构化代码方案","slug":"meshcoder-革新3d生成的结构化代码方案","link":"#meshcoder-革新3d生成的结构化代码方案","children":[]},{"level":3,"title":"微软开源智能呼叫中心替代人工客服","slug":"微软开源智能呼叫中心替代人工客服","link":"#微软开源智能呼叫中心替代人工客服","children":[]},{"level":3,"title":"超对称开源 Monte Carlo 注意力","slug":"超对称开源-monte-carlo-注意力","link":"#超对称开源-monte-carlo-注意力","children":[]},{"level":3,"title":"WhisperLiveKit：本地实时语音转文字神器","slug":"whisperlivekit-本地实时语音转文字神器","link":"#whisperlivekit-本地实时语音转文字神器","children":[]}]},{"level":2,"title":"算法论文","slug":"算法论文","link":"#算法论文","children":[{"level":3,"title":"谢赛宁等提出视频多模态LLM新范式","slug":"谢赛宁等提出视频多模态llm新范式","link":"#谢赛宁等提出视频多模态llm新范式","children":[]},{"level":3,"title":"谷歌Nested Learning让AI拥有持续学习力","slug":"谷歌nested-learning让ai拥有持续学习力","link":"#谷歌nested-learning让ai拥有持续学习力","children":[]},{"level":3,"title":"TrajSelector：0.6B模型撬动复杂推理","slug":"trajselector-0-6b模型撬动复杂推理","link":"#trajselector-0-6b模型撬动复杂推理","children":[]}]}],"git":{"updatedTime":1764043728000,"contributors":[{"name":"GitHub Actions","username":"","email":"actions@github.com","commits":1}],"changelog":[{"hash":"10121d006e56e0857071d8726b6ffbb2209610be","time":1764043728000,"email":"actions@github.com","author":"GitHub Actions","message":"Auto-commit generated files on 2025-11-25T04:08:48.515Z"}]},"filePathRelative":"posts/2025-11-10.md","excerpt":"<blockquote>\\n<p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。\\n欢迎关注公众号「AI Reading Hub」，获取更多AI资讯和技术文章。</p>\\n</blockquote>\\n<h1>2025-11-10 资讯日报</h1>\\n<h2>新闻资讯</h2>\\n<h3>AAAI 2026录用揭晓，审稿引争议</h3>\\n<p>AAAI 2026录用结果揭晓，投稿23,680篇，录用率17.6%。北大顾怿洋、南洋理工加小俊等研究员成果颇丰。但Reddit上有人质疑审稿过程，称存在‘关系户’抬分现象。<a href=\\"https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f0055191a7908ced6fc4543d68c61eb32b99a443f7e5d58511b32e80aee3b5a0e05ca2619233&amp;idx=1&amp;mid=2652643627&amp;sn=6887dbda64d7b14599d683940341b5dd#rd\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">&gt;阅读原文</a></p>"}');export{s as comp,p as data};
